import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar.jsx';
import Home from './pages/Home.jsx';
import OurSchool from './pages/OurSchool.jsx';
import OurStaff from './pages/OurStaff.jsx';
import StudentsCorner from './pages/StudentsCorner.jsx';
import Gallery from './pages/Gallery.jsx';
import ContactUs from './pages/ContactUs.jsx';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/our-school" element={<OurSchool />} />
          <Route path="/our-staff" element={<OurStaff />} />
          <Route path="/students-corner" element={<StudentsCorner />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/contact-us" element={<ContactUs />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
